val USEFULL_MEMORY_FRACTION = 0.9

def calculateWastage(executorMemoryMB:Long, executorOverheadMB:Long, executorCores:Long, slaveType:String) :(Int, Int) = {
    if (executorMemoryMB == 0 || executorCores == 0 ) {
        return (0, 0)
    }
    val totalExecutorMemory =  executorMemoryMB+executorOverheadMB
    val totalSlaveMemory = memoryMapping.getOrElse(slaveType, totalExecutorMemory*(1/USEFULL_MEMORY_FRACTION))
    val maxAvailableMemory = totalSlaveMemory.toDouble * USEFULL_MEMORY_FRACTION
    val maxExecutorsByMem = Math.floor(maxAvailableMemory/totalExecutorMemory).toInt 
    val slaveCores:Int  = coreMapping.getOrElse(slaveType, executorCores.toInt)
    val maxExecutorsByCores =  Math.floor(slaveCores/executorCores).toInt

    val maxExecutors = Math.min(maxExecutorsByMem, maxExecutorsByCores)

    val wastedMemory = maxAvailableMemory - (maxExecutors*totalExecutorMemory)
    val memoryWastedPercentage = (100* wastedMemory/maxAvailableMemory).toInt
    val wastedCores = slaveCores - maxExecutors * executorCores
    val coresWastedPercentage = (100* wastedCores/slaveCores).toInt
    (memoryWastedPercentage, coresWastedPercentage)
} 


def memoryWastage(executorMemoryMB:Long, executorOverheadMB:Long, executorCores:Long, slaveType:String): Int = {
    val wastage = calculateWastage(executorMemoryMB, executorOverheadMB, executorCores, slaveType)
    wastage._1a
}

def coreWastage(executorMemoryMB:Long, executorOverheadMB:Long, executorCores:Long, slaveType:String): Int = {
    val wastage = calculateWastage(executorMemoryMB, executorOverheadMB, executorCores, slaveType)
    wastage._2
}

import org.apache.spark.sql.functions._

def parseMemory(memoryAsString: String) : Int = {
     val KBMemory  = "([0-9]+)[K|k]".r
     val MBMemory  = "([0-9]+)[M|m]".r
     val GBMemory  = "([0-9]+)[G|g]".r

     val result = memoryAsString match {
        case KBMemory(x) =>  x.toInt/1024
        case MBMemory(x) =>  x.toInt
        case GBMemory(x) =>  x.toInt * 1024
        case _ => 0
     }
     result
} 

def parseInt(intAsString : String) : Int = {
    val  IntPattern = "([0-9]+)".r
    val toReturn  = intAsString match {
        case IntPattern(x) => x.toInt
        case _ => 0
    } 
    toReturn 
}

def parseLong(longAsString : String) : Long = {
    val  LongPattern = "([0-9]+)".r
    val toReturn  = longAsString match {
        case LongPattern(x) => x.toLong
        case _ => 0L
    } 
    toReturn 
}

def parseConfig(customConfig: String, extract: String): Int = {
    if (customConfig == null) {
        return 0
    }
    var executorCount    = 0 
    var maxExecutors     = 0
    var executorMemoryMB = 0
    var executorOverheadMB = 0
    var driverMemoryMB   = 0
    var executorCores    = 0
    val confParts = customConfig.split(" ")
    for (a <- 0 to (confParts.size-2)) {
        confParts(a) match {
                 case "spark.executor.memory"=> {
                     executorMemoryMB =  parseMemory(confParts(a+1))
                }
                case "spark.driver.memory" => {
                    driverMemoryMB =  parseMemory(confParts(a+1))
                }
                case "spark.executor.cores" => {
                    executorCores =  parseInt(confParts(a+1))
                }
                case "spark.executor.instances" => {
                    executorCount =  parseInt(confParts(a+1))
                }
                case "spark.dynamicAllocation.maxExecutors" => {
                    maxExecutors =  parseInt(confParts(a+1))
                }
                 case "spark.qubole.max.executors" => {
                    maxExecutors =  parseInt(confParts(a+1))
                }
                case "spark.yarn.executor.memoryOverhead" => {
                    executorOverheadMB = parseInt(confParts(a+1))
                }
                case _ => 
            }
    }
    val toReturn = extract match {
        case "executorCount" => executorCount
        case "maxExecutors" => maxExecutors
        case "executorCores" => executorCores
        case "executorMemoryMB" => executorMemoryMB
        case "executorOverheadMB" => executorOverheadMB
        case "driverMemoryMB" => driverMemoryMB
        case _ => 0
    }
    toReturn
}

def parseCommand(commandLine: String, arguments: String, customConfig: String, extract: String) : Int = { 
    if ((commandLine == null) && (arguments == null)) {
        return 0
    }

    //we get either of these two. so we are good here.
    val args = { if (commandLine == null) {
                    arguments.split(" ") 
                 } else {
                     if (arguments == null)  {
                        commandLine.split(" ")
                     }else {  
                        arguments.split(" ") ++ commandLine.split(" ")
                     }
                 }
               }   
    if (args.size <= 1) {
        return 0    
    }
    var executorCount    = 0 
    var maxExecutors     = 0
    var executorMemoryMB = 0
    var executorOverheadMB = 0
    var driverMemoryMB   = 0
    var executorCores    = 0
    for (a <- 0 to (args.size-2)) {
        val  x  =  args(a) match {
        case "--num-executors"   => executorCount = parseInt(args(a+1))
        case "--max-executors"   => maxExecutors  = parseInt(args(a+1))
        case "--executor-cores"  => executorCores = parseInt(args(a+1))
        case "--executor-memory" => executorMemoryMB = parseMemory( args(a+1))
        case "--driver-memory"   => driverMemoryMB = parseMemory( args(a+1))
        case "--conf" => {
            //need to further parse --conf parameters by splitting on equalto
            val confParts = args(a+1).split("=")
            confParts(0) match {
                case "spark.executor.memory"=> {
                    if (executorMemoryMB == 0 && confParts.size > 1) {
                        executorMemoryMB =  parseMemory(confParts(1))
                    }
                }
                case "spark.driver.memory" => {
                    if (driverMemoryMB == 0 && confParts.size > 1) {
                        driverMemoryMB =  parseMemory(confParts(1))
                    }
                }
                case "spark.executor.cores" => {
                    if (executorCores == 0 && confParts.size > 1) {
                        executorCores =  parseInt(confParts(1))
                    }
                }
                case "spark.executor.instances" => {
                    if (executorCount == 0 && confParts.size > 1) {
                        executorCount =  parseInt(confParts(1))
                    }
                }
                case "spark.dynamicAllocation.maxExecutors" => {
                    if (maxExecutors == 0 && confParts.size > 1) {
                        maxExecutors =  parseInt(confParts(1))
                    }
                }
                case "spark.qubole.max.executors" => {
                    if (maxExecutors == 0 && confParts.size > 1) {
                        maxExecutors =  parseInt(confParts(1))
                    }
                }
                case "spark.yarn.executor.memoryOverhead" => {
                    if (executorOverheadMB == 0 && confParts.size > 1) {
                        executorOverheadMB =  parseInt(confParts(1))
                    }
                }
                case _ => 
            }

        }
        case _ =>
        }
    }

    var toReturn = extract match {
        case "executorCount" => executorCount 
        case "maxExecutors" => maxExecutors
        case "executorCores" => executorCores
        case "executorMemoryMB" => executorMemoryMB
        case "executorOverheadMB" => executorOverheadMB
        case "driverMemoryMB" => driverMemoryMB
        case _ => 0
    }
    if (toReturn == 0) {
       toReturn = parseConfig(customConfig, extract)
       if (toReturn == 0 ) {
            toReturn = extract match {
            case "executorCount" => 2 
            case "maxExecutors" => 2
            case "executorCores" => 2
            case "executorMemoryMB" => 0
            case "executorOverheadMB" => 0
            case "driverMemoryMB" => 0
            case _ => 0
            }
        }
    }
    return toReturn
}
